import { Form, Formik } from "formik";
import React, { useEffect, useState } from "react";
import FormikInput from "./Formik/FormikInput";
import axios from "axios";
import FormikTextArea from "./Formik/FormikTextArea";
import FormikSelect from "./Formik/FormikSelect";
import Select from 'react-select'


const CreateHTLocation = () => {
    let [attributes, setAttributes] = useState([]);
  let getAttributes = async () => {
    try {
      let result = await axios({
        url: `http://localhost:8000/attributes`,
        method: `get`,
        headers: {
          Authorization: `Bearer ${localStorage.getItem("token")}`,
        },
      });
      setAttributes(result.data.result);
      console.log(result);
    } catch (error) {
        console.log(error)
    }
  };
  useEffect(() => {
    getAttributes();
  }, [])
  let initialValues = {
    hTName: "",
    location: "",
    length: "",
    elevationGain: "",
    description: "",
    startLatitude: "",
    startLongitude: "",
    endLatitude: "",
    endLongitude: "",
    attributes: "",
  };
  let onSubmit = () => {};
  const options = [
    { value: 'chocolate', label: 'Chocolate' },
    { value: 'strawberry', label: 'Strawberry' },
    { value: 'vanilla', label: 'Vanilla' }
  ]
  
  return (
    <>
       <Formik
      initialValues={initialValues}
      // validationSchema={}
      onSubmit={onSubmit}
    >
      {(formik) => {
        return (
          <Form>
            <FormikInput
              id="hTName"
              label="Hike/Trek name"
              type="text"
              name="hTName"
              onChange={(e) => {
                formik.setFieldValue("hTName", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <br></br>
            <FormikInput
              id="location"
              label="Location"
              type="text"
              name="location"
              onChange={(e) => {
                formik.setFieldValue("location", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <br></br>
            <span>Starting Point</span>
            <FormikInput
              id="startLatitude"
              type="text"
              name="startLatitude"
              placeholder="Latitude"
              onChange={(e) => {
                formik.setFieldValue("startLatitude", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <FormikInput
              id="startLongitude"
              type="text"
              name="startLongitude"
              placeholder="Longitude"
              onChange={(e) => {
                formik.setFieldValue("startLongitude", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <br></br>
            <span>Ending Point</span>
            <FormikInput
              id="endLatitude"
              type="text"
              name="endLatitude"
              placeholder="Latitude"
              onChange={(e) => {
                formik.setFieldValue("endLatitude", e.target.value);
              }}
              required={true}
            ></FormikInput>
            <FormikInput
              id="endLongitude"
              type="text"
              name="endLongitude"
              placeholder="Longitude"
              onChange={(e) => {
                formik.setFieldValue("endLongitude", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <br></br>
            <FormikInput
            label="Length with units"
              id="length"
              type="text"
              name="length"
              placeholder="length"
              onChange={(e) => {
                formik.setFieldValue("length", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <br></br>
            <FormikInput
            label="Elevation Gain"
              id="elevationGain"
              type="text"
              name="elevationGain"
              placeholder="elevationGain"
              onChange={(e) => {
                formik.setFieldValue("elevationGain", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <FormikInput
            label="Attributes"
              id="attributes"
              type="text"
              name="attributes"
              placeholder="Attributes separated by comma(,)"
              onChange={(e) => {
                formik.setFieldValue("elevationGain", e.target.value);
              }}
              required={false}
            ></FormikInput>
            <br></br>
            <FormikTextArea
                name="description"
                id="description"
                onChange={(e) => {formik.setFieldValue("description", e.target.value)}}
                label="Description: "
                placeholder="Write about the location here"
            ></FormikTextArea>
          </Form>
        );
      }}
    </Formik>
    <Select options={options}></Select>
    </>
 
  );
};

export default CreateHTLocation;
